import { useEffect, useState } from 'react'
import "./Details.css"

export const StaffList = () => { 

    const [staff, setStaff] = useState([])
    // const [title, setTitle] = useState([])

    useEffect( 
        () => { 
            fetch(`http://localhost:8088/users?isStaff=true`) 
                .then(response => response.json())
                .then((staffArray) => { 
                    setStaff(staffArray)
                })
        }
    )

    // useEffect(
    //     () => { 
    //         fetch(`http://localhost:8088/titles?_embed=staffTitles&_embed=staff`) 
    //             .then(response => response.json())
    //             .then((titleArray) => { 
    //                 setTitle(titleArray)
    //             })

    //     }
    // )



    return ( 
        <div className="staffMembers">
            <h2>Our Staff</h2>
            { 
                staff.map((staff) => { 
                    return <div className="staff">
                        Name: {staff.fullName}

                    </div>
                })
            }
        </div>
    )
}
